INSERT INTO `findknowledge` VALUES ('1', '1', '明日起汽柴油价格每升分别下降0.1元和0.12元', 'http://img5.cache.netease.com/cnews/2014/9/16/20140916193749dfd38_550.jpg', '1', ' <div id=\"endText\" class=\"end-text\">\r\n                <p class=\"f_center\"><img src=\"http://img5.cache.netease.com/cnews/2014/9/16/20140916193749dfd38_550.jpg\" alt=\"9月16日，国家发展改革委发出通知，汽、柴油（标准品，下同）供应价格每吨分别降低140元和135元。\" /><br  />9月16日，国家发展改革委发出通知，汽、柴油（标准品，下同）供应价格每吨分别降低140元和135元。</p><p>国家发改委9月16日发出通知，汽、柴油（标准品，下同）供应价格每吨分别降低140元和135元，调整后的汽、柴油供应价格分别为每吨8300和7200元。测算到零售价格，90号汽油和0号柴油（全国平均）每升分别降低0.10元和0.12元。此次调价执行时间为9月16日24时。</p><p>2014年以来，汽柴油最高零售价上调4次、下调则多达8次，剩下5次均为搁浅。年内，汽柴油最高零售价分别净跌525元/吨和505元/吨。</p><p>汽柴油批发价跌幅更甚，截至9月15日，国内0#柴油、93#国标汽油和93#调和汽油价格分别较年初下跌1008元/吨、713元/吨和354元/吨。除了调和汽油受成本制约下跌幅度不及调价幅度，0#柴油及93#汽油均超调幅下跌。</p><p>此次是油价自2009年调整最高零售限价已来首现 “四连跌”。按照此前统计，自2009年国内成品油与原油直接挂钩及调整最高零售限价以来，只有2012年和2013年出现过“三连跌”的局面。</p><p>9月上旬以来，受全球油品市场供应充足、需求乏力等因素影响，国际市场油价震荡下行，前10个工作日平均价格继续回落。</p><p>据卓创资讯分析，由于国内现行成品油定价机制主要依附于欧美原油价格变动情况，而国际原油价格走向相对较为反复，国内成品油价格出现单边下行走势。</p><p>金银岛原油分析师王栋分析，乌克兰危机持续，伊拉克处于“战争局势”，再加上中国工业数据不佳削弱需求前景，国际原油期价近期涨跌互现。</p><p>此次下调，对于私家车而言，以月跑2000公里，每百公里8L汽油的私家车为例，此轮汽油每升下跌0.10元，相应的下个计价周期的油耗成本将减少8元左右。</p><p>“按现在的物价水平来看，8元微不足道，但起码在心理上会让消费者得到些许安慰。 ”卓创资讯成品油分析刘芸说。</p><p>对于运输行业而言，以载重50吨的货车，每月平均跑10000公里左右，百公里油耗38L为例。按照此轮0.10元/升的跌幅测算，在下一个计价周期的时间里，将减少209元左右的油耗成本。出租车的运营成本也将有适度减少，预计部分地区的燃油附加费或有微幅调整。</p><p>卓创资讯成品油分析师胡惠春分析，预计下调落实后，主营汽柴批发下滑幅度不及发改委下调幅度，导致国内汽柴批零价差进一步收窄，民营加油站利润再次被挤压，其利润的黄金阶段一去不复返。</p><p><!-- AD200x300_2 -->\r\n<div class=\"gg200x300\">\r\n<iframe src=\"http://g.163.com/r?site=netease&affiliate=news&cat=article&type=logo300x250&location=13\" width=\"300\" height=\"250\" frameborder=\"no\" border=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"> </iframe>\r\n</div><p>有业内人士分析表示，随着天气转冷，汽车空调用油回落，汽油需求回落。加之现行定价机制下，市场投机需求被极大抑制，高风险之下，贸易商将保持快进快出的低库存策略，因此预计今年四季度国内汽柴批发市场将延续疲软态势。</p><p>卓创资讯原油分析师高健认为，因国庆调休，成品油下一轮调价窗口将于9月29日24时开启。原油市场依旧是利空消息充斥，在利比亚原油增产的同时，欧美炼厂将进入检修期，会进一步加剧供需矛盾。除此之外，美元汇率强势的局面仍在延续，中欧经济形势整体表现低迷，上述利空局面短期内估计难有好转。所以，后期原油价格将整体维持低位运行，即便反弹预计幅度有限，成品油价格不排除五连跌的可能性。</p><p>(原标题：国家降低成品油价格)</p>\r\n                                                                                <div class=\"ep-source cDGray\">\r\n                    <span class=\"left\"><a href=\"http://news.163.com/\"><img src=\"http://img1.cache.netease.com/cnews/css13/img/end_news.png\" alt=\"netease\" width=\"13\" height=\"12\" class=\"icon\"></a> 本文来源：发改委网站  </span>\r\n                                    </div>\r\n                            </div>', '2014-09-16 20:18:31', '0', null, null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b48b6c3010148f80b13510000', null, '儿童糖尿病人血糖监测很重要', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410101112284970.jpg', '2', '&nbsp; &nbsp; &nbsp; 核心提示：糖尿病人的日常血糖监测是制定稳定控制血糖各项措施的依据，监测次数因人而异，应根据病情监测每餐前、餐后2小时、睡前及凌晨血糖。病情不稳定及在疾病急性期者，一日需测血糖4-8次，病情稳定后逐渐减少。<br />\r\n　　血糖检测对糖尿病患儿的诊断和治疗更具特殊意义。对有下列症状的儿童和青少年应及时检测血糖，以利于早诊断、早治疗。<br />\r\n　　如饮水量和尿量增加、尤其夜间尿量增加；易饥饿、进食增加但体重下降；身体虚弱、易患病；视力模糊、注意力不集中；肥胖或超重，尤其伴有黑棘皮症或多囊卵巢者；有2型糖尿病家属史；孕妇营养过剩导致的巨大婴儿以及妊娠期营养不良导致的低体重婴儿。<br />\r\n　　此外，酮症酸中毒是1型糖尿病的主要急性并发症。该症早期可表现为感染和消化道症状，对于感染不易控制、恶心呕吐、腹泻以及急性腹痛者检测血糖，有助于鉴别诊断和正确治疗。1型糖尿病的血糖水平波动大，易发生低血糖，低血糖会影响儿童和青少年的大脑的生长和发育。因此，依据严密的血糖监测，及时调整饮食、体力活动和药物剂量，能有效预防低血糖。<br />\r\n　　糖尿病人的日常血糖监测是制定稳定控制血糖各项措施的依据，监测次数因人而异，应根据病情监测每餐前、餐后2小时、睡前及凌晨血糖。病情不稳定及在疾病急性期者，一日需测血糖4-8次，病情稳定后逐渐减少。', '2014-10-10 11:12:28', '1', '儿童 糖尿病 血糖', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b48b6c3010148f80dd1b90001', null, '健康讲堂：如何科学防治糖尿病？', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410101115283130.jpg', '2', '<p>&nbsp;<span style=\"background-color:rgb(153, 204, 0)\"><strong>中国糖尿病流行的现状</strong></span></p>\r\n\r\n<p>　　◆ 我国成人糖尿病患病率已超过11%；</p>\r\n\r\n<p>　　◆ 估计我国现有患者超过4千万，居世界第2位；</p>\r\n\r\n<p>　　◆ 糖尿病发病趋向低龄化：据统计，目前糖尿病发病年龄较之十几年前提早了20至30岁，甚至只有1岁多的婴儿也因急性糖尿病被早早送进了医院。</p>\r\n\r\n<p>　　糖尿病分型</p>\r\n\r\n<p>　　◆ 1型糖尿病：占糖尿病的10%以下，多数发病年龄较早。患者胰岛B细胞破坏，胰岛素绝对不足，因此需要依赖胰岛素治疗，也就是说病友从发病开始就需使用胰岛素治疗，并且终身使用。因此1型糖尿病又叫胰岛素依赖型糖尿病(IDDM)或青少年糖尿病，该型易出现糖尿病酮症酸中毒(DKA)，应警惕。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>　　◆ 2型糖尿病：占糖尿病患者的90%以上，多数发病年龄较晚。患者体内的胰岛B细胞未完全破坏，胰岛素处于一种相对缺乏状态，可以通过某些口服药物刺激体内胰岛素的分泌，适当的时候也可通过注射胰岛素来进行治疗。</p>\r\n\r\n<p>　　◆ 特殊类型糖尿病：如其他疾病所导致的糖尿病。</p>\r\n\r\n<p>　　◆ 妊娠糖尿病(GDM)：妊娠期伴有糖尿病。</p>\r\n\r\n<p>　　从病因入手，预防糖尿病的发生或加重</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>　　1、遗传缺陷：无论是1型还是2型糖尿病，都具有遗传倾向，这是我们不能着手改变的因素。</p>\r\n\r\n<p>　　2、环境因素：主要指生活方式的改变。环境因素对糖尿病的影响非常大，尤其是2型糖尿病；因此要防治糖尿病，必须从改变这些可以改变的因素着手：</p>\r\n\r\n<p>　　少动&mdash;&mdash;体力活动减少是诱发2型糖尿病的重要环境因素。因为人体骨骼肌是最大的葡萄糖利用的器官，长期缺乏体力活动将会大大减少肌肉对葡萄糖的利用，导致肌肉萎缩、肌肉组织中的脂肪含量增加、肥胖和胰岛素抵抗。</p>\r\n\r\n<p>　　饮食&mdash;&mdash;饮食结构的改变，例如从植物性膳食转变为动物性膳食，导致了总热量的过剩，进而储存在体内变成脂肪组织，成为诱发糖尿病的根源。</p>\r\n\r\n<p>　　肥胖&mdash;&mdash;遗传、缺少运动、吃的太多、太油腻、高热量饮食都可导致肥胖。其中，晚上吃得过饱最容易导致肥胖，因为一吃完就睡觉，脂肪代谢缓慢，在体内堆积，导致肥胖;肥胖进一步引起胰岛素抵抗，最终导致糖尿病。</p>\r\n\r\n<p>　　老龄&mdash;&mdash;由于生活方式的西化和自然寿命的延长，人口老龄化进程的加速，老年人增多，糖尿病老年人的发病率高，因此老年人人数的增多相对来说也使得糖尿病病人增多。</p>\r\n\r\n<p>　　吸烟&mdash;&mdash;日本的一项健康研究表明，吸烟会增加罹患糖尿病的危险性，且罹患糖尿病的危险度与吸烟的剂量呈正相关性，亦即吸烟量愈多，得第2型糖尿病的机率愈高。</p>\r\n\r\n<p>　　妊娠&mdash;&mdash;妊娠糖尿病与妊娠期胎盘产生的大量的胎盘生乳素、雌激素、孕激素有关，有些激素可能有对抗胰岛素的作用。有关专家发现妊娠次数与糖尿病的发病有关，多次妊娠易使遗传因素转弱诱发糖尿病。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>　　药物&mdash;&mdash;有些药物会导致血糖升高，如利尿剂、糖皮质激素、&beta;受体阻滞剂等，还有一些中药也有可能引起血糖升高。所以，如果你是糖尿病患者，在就诊的时候一定要提醒医生。</p>\r\n\r\n<p>　　以上的这些常见的因素是可以着手改变的。因此，预防糖尿病，必须注意以上这些因素；得了糖尿病的人，更要行动起来，慢慢改变这些因素。糖尿病基本临床表现</p>\r\n\r\n<p>　　将近80%的糖尿病病人都是在健康体检时查出血糖偏高，而他们自己却感觉没什么不舒服。糖尿病在早期的时候，它的典型症状表现并不明显，或者有出现多饮多尿等症状，但没有引起足够的重视，以为是正常。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>　　◆ 糖尿病典型症状：&ldquo;三多一少&rdquo;，即多饮、多尿、多食、体重下降；</p>\r\n\r\n<p>　　◆ 视力模糊：因为房水的渗透压受血糖的调节，血糖高，房水的渗透压随之升高，进而导致视力模糊；</p>\r\n\r\n<p>　　◆ 2型糖尿病可有皮肤瘙痒，尤其是老年女性糖尿病患者，常常出现顽固的外阴瘙痒，很难治愈;</p>\r\n\r\n<p>　　多数病人起病隐匿，无明显症状，以并发症或伴发病就诊。早期糖尿病表现为胰岛素分泌时相异常，很容易饥饿，可表现为低血糖症状。此外，在围手术期发现血糖高，以及在应激状态(感冒发烧、中风、心肌梗死等情况)下发现血糖升高的人应该要怀疑糖尿病。</p>\r\n\r\n<p>　　因此，建议高危人群(如有遗传倾向者、肥胖者、老年人、妊娠糖尿病、胖大婴儿、宫内发育不全者等)，应该进行健康体检，便于早期发现糖尿病。</p>\r\n\r\n<p>　　糖尿病慢性并发症：表现为脑血管病变、冠心病、神经病变、糖尿病肾病、视网膜病变、白内障、青光眼等。</p>\r\n\r\n<p>　　糖尿病的慢性并发症</p>\r\n\r\n<p><strong>　　</strong><span style=\"background-color:rgb(153, 204, 0)\"><strong>诊断线索</strong></span></p>\r\n\r\n<p>　　1、&ldquo;三多一少&rdquo;症状；</p>\r\n\r\n<p>　　2、 从并发症、伴发病发现糖尿病患者：</p>\r\n\r\n<p>　　◆ 原因不明的酸中毒、失水、昏迷、休克；</p>\r\n\r\n<p>　　◆ 反复发作的皮肤疖或痈，结核病等；</p>\r\n\r\n<p>　　◆ 血脂异常、高血压、冠心病、脑卒中、肾病、视网膜病、周围神经炎、下肢坏疽以及代谢综合征等。</p>\r\n\r\n<p>　　3、高危人群：</p>\r\n\r\n<p>　　◆ 糖尿病前期[IFG和(或)IGT]；</p>\r\n\r\n<p>　　◆ 年龄超过35岁、肥胖或超重；</p>\r\n\r\n<p>　　◆ 巨大胎儿史、糖尿病或肥胖家族史。</p>\r\n\r\n<p>　　4、并发症和伴发病的诊断</p>\r\n\r\n<p>　　有糖尿病的各种并发症者(如脑血管病变、冠心病、神经病变、糖尿病肾病、视网膜病变、白内障、青光眼等)，伴随出现的肥胖、高血压、血脂异常等患者，也须进行相应检查和诊断以便给予治疗。</p>\r\n\r\n<p>　<strong>　</strong><span style=\"background-color:rgb(153, 204, 0)\"><strong>糖尿病五项基本治疗措施</strong></span></p>\r\n\r\n<p>　　1、饮食治疗</p>\r\n\r\n<p>　　◆ 均衡的饮食：50%米面杂粮为主食，菜以蔬菜为主，豆制品、奶制品要适当吃，油盐糖要少吃，水果适量吃，宜饭前吃为佳。</p>\r\n\r\n<p>　　◆ 有规律的饮食</p>\r\n\r\n<p>　　◆ 达到和保持理想的体重</p>\r\n\r\n<p>　　◆ 为健康和成长提供充足的营养</p>\r\n\r\n<p>　　2、运动治疗：&ldquo;一、三、五、七&rdquo;运动法</p>\r\n\r\n<p>　　◆&ldquo;一&rdquo;&mdash;&mdash;至少选择一种适宜的运动</p>\r\n\r\n<p>　　◆ 三&rdquo;&mdash;&mdash;每次运动时间在30分钟以上</p>\r\n\r\n<p>　　◆&ldquo;五&rdquo;&mdash;&mdash;每周运动五次以上</p>\r\n\r\n<p>　　◆&ldquo;七&rdquo;&mdash;&mdash;运动后心率加年龄约为170</p>\r\n\r\n<p>　　3、药物治疗</p>\r\n\r\n<p>　　◆ 口服降糖药：药物一定要根据病人的具体情况来选择，患者要配合执行医生的方案，坚持正确服药，自己要买保健品的话最好是先咨询一下医生，看是否适合自己吃。</p>\r\n\r\n<p>　　◆ 胰岛素和胰岛素类似物：有些人担心胰岛素会&ldquo;成瘾&rdquo;，这是错误的。1型糖尿病一定要依赖胰岛素，部分胰岛功能受损严重的2型糖尿病也要使用胰岛素；还有一些肝肾功能不太好的病人，吃药可能作用不明显了，这时候也可以选择打胰岛素。</p>\r\n\r\n<p>　　4、糖尿病教育</p>\r\n\r\n<p>　　(1)糖尿病是一种复杂的慢性终身疾病;</p>\r\n\r\n<p>　　(2)糖尿病的治疗是一项长期并随病程的进展不断调整的管理过程 ，它包括：</p>\r\n\r\n<p>　　◆ 根据糖尿病的自然病程和病情及时调整糖尿病的治疗方案 ；</p>\r\n\r\n<p>　　◆ 糖尿病教育,以帮助患者掌握糖尿病自我管理的技巧；</p>\r\n\r\n<p>　　◆ 糖尿病并发症的监测和治疗；</p>\r\n\r\n<p>　　◆ 糖尿病患者相关数据的系统管理。</p>\r\n\r\n<p>　　5、监测</p>\r\n\r\n<p>　　◆ 自我监测血糖，应用便携式血糖计经常观察和记录患者血糖水平，为调整药物剂量提供依据。</p>\r\n\r\n<p>　　◆ 每2～3个月定期复查糖化血红蛋白(A1C)，了解糖尿病病情控制程度，及时调整治疗方案。</p>\r\n\r\n<p>&nbsp;&nbsp; 　◆ 每年1～2次全面复查，着重了解血脂以及心、肾、神经和眼底情况，尽早发现大血管、微血管并发症，给予相应治疗。</p>\r\n', '2014-10-10 11:15:28', '1', '糖尿病 预防', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b48b6c3010148f81047ae0002', null, '全国高血压日转盘游戏教你防病', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410101118095820.jpg', '1', '<p style=\"text-align:justify\">国庆大假过后，除了投入工作，也该关注一下自己的健康问题了！10月8日是&ldquo;全国高血压日&rdquo;，在高血压这种慢性病日益侵袭大众健康的当下，我们该如何来预防它带来的风险呢？成华区疾控中心昨天在新华公园用&ldquo;转盘游戏&rdquo;的方式给大家进行了解析，由于转盘游戏简单易懂又易记，它让参与的市民非常乐于接受。</p>\r\n\r\n<p style=\"text-align:justify\">记者在现场看到，这种健康转盘有三种，分别是&ldquo;每日万步活动量速查卡&rdquo;&ldquo;生活方式患慢病风险速查卡&rdquo;和&ldquo;运动强度速查卡&rdquo;。万步活动量速查卡是用来测试活动量合格与否的，上面分了若干条量化指标，比如中速步行10分钟相当于1000步，拖地8分钟相当于1000步，爬山4分钟相当于1000步等等，根据这些记录标准，市民很容易判断自己一天的活动量是否达到一万步的合格要求。</p>\r\n\r\n<p style=\"text-align:justify\">而生活方式患慢病风险速查卡则是用来判断你是否有患高血压等慢性病的风险的，比如，不吃早餐1级、心态不平衡1级，工作过度紧张2级、三餐和睡眠无规律4级等等，按照这些标准，如果级数达到20级，患慢病的风险就较高，达到40级，患慢病的风险高，而达到60级或以上，患慢性病的风险极高。&ldquo;这些级数的量化记录，都是在市民日常生活中可记录的，大家用它一计算，就知道如何去防范慢病风险了。&rdquo;成华区疾控中心副主任王超对记者说。另外一个运动强度速查卡是用来计算心率是否标准的，市民同样很容易计算出自己的运动强度是否合格。</p>\r\n\r\n<p style=\"text-align:justify\">王超告诉记者，在成都，高血压等慢性疾病仍呈上升趋势，因此社区防治和家庭健康普及尤为重要，而健康转盘游戏是市民乐于接受的一种普及方法，&ldquo;我们制作了上万份发放给居民，让大家在日常生活中知道如何去预防慢性病。&rdquo;</p>\r\n', '2014-10-10 11:18:09', '0', '全国高血压日转盘游戏教你防病', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b48b6c3010148f81162d40003', null, '用改变生活方式来控制高血压', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/20141010111922680.jpg', '1', '<p>每年的10月8日是世界高血压日。这个日子正赶上十一长假后的第一天。不知为何，经历了十一这样一个长假，记者原本控制挺好的血压突然间又高了，于是慌张地跑去找曾经为自己看过高血压的北京航空总医院心血管内科主治大夫王立中。</p>\r\n\r\n<p>　　王大夫在为记者量了血压后问我长假期间都做什么了，我说坐了一天火车又开了一天车为亲人去扫墓，又回东北老家陪患病的母亲在家住了几天。期间为给母亲改善生活，几乎天天领着母亲去饭店吃饭。王大夫说，问题就出在这了，长假期间暴饮暴食，又车马劳顿，很容易引起血压不稳。加之回东北气温较低，突然间不适应气候温差，极易引发血压突然间升高。</p>\r\n\r\n<p>　　那遇到这种情况又该如何改善呢？王大夫说，治疗高血压除了吃药外，就是生活方式的改善。如果患了高血压，生活方式的改善是一个非常重要的问题。包括几点：第一点一定要控制体重。控制体重很重要的一点就是要适当的锻炼，并且一定要做一个持之以恒的锻炼。很多人可能会选择突击锻炼，比如周末有时间，跑跑步就完了，但这种锻炼是不行的。锻炼要做到持之以恒，而且锻炼要每天适度的锻炼，适当的活动量是关键，要根据自己的心率来控制这个量。180减去年龄就是需要达到的锻炼后最快的每分钟心率。比如50岁的人，180减去50，就是130，达到心率130次／分，达到这样一个运动量就比较合适了。而且每次锻炼在20分钟到一个小时左右最好。这样坚持做锻炼，才可达到控制体重的目的。因为体重下降可以导致血压的下降。如果体重减轻了5至10公斤左右，血压可以下降5至20mmHg。</p>\r\n\r\n<p>　　第二点是要限盐。王大夫告诫，已经得了高血压的病人，在吃饭的时候一定不要吃太咸。目前世界卫生组织对于限盐有明确的规定，是每天要吃小于六克的盐。可能你会吃东西觉得很淡，很没有味，但是尽量要习惯，并且要少吃腌制的东西，限盐对于血压控制也是非常重要的，如果管不住嘴，吃再多降压药也是无用的。</p>\r\n\r\n<p>　　第三点是戒烟、戒咖啡。王大夫强调，因为尼古丁是可以导致血管收缩的，所以戒烟对于血压控制也是非常必要的。当你摆脱了尼古丁，你的血压不仅会下降，血管也将变得很干净，会减少很多堵塞的机会。而对于女性朋友来说，得了高血压就一定要戒掉自己喜欢的咖啡及咖啡饮料，王大夫说，记者此次血压假期升高就是和劳累后大量饮用咖啡有关，因为咖啡因有很强的血管刺激作用，一定要限量，或干脆戒掉。</p>\r\n\r\n<p>　　还有一点就是要戒酒。王大夫说，可能很多人都提到，少量饮酒可以减少冠心病的发病率，但是对于高血压的病人来说，我们是不主张高血压病人喝酒的，而且更不主张大量地饮酒。对于高血压的病人，最好是要限制酒，或者能不喝就尽量不喝。如果说我没办法，我必须要喝，那也要限制一定的量，并且最好饮用葡萄酒。但即使是葡萄酒，一般也是每天限制在三两左右，啤酒则要限制在半斤到一斤，白酒最好在半两到一两，这是针对男性。如果是女性就要减半。孕妇高血压患者则最好不要喝酒。</p>\r\n\r\n<p>　　最后要说的一点是要避免精神紧张和劳累，尽量减少自己生活方面的压力。像工作压力、生活压力、亲人离去、离异等都会引发高血压患者血压控制失衡，这时候就要学会淡定处事、荣辱不惊，尽快让自己远离哀伤、忧愁、怨恨、愤慨等负面情绪，要知道情绪失控不仅会引起血压升高，更甚者会由于突然间的血压升高导致脑出血、心梗等发作，后果不堪设想。</p>\r\n', '2014-10-10 11:19:22', '1', '用改变生活方式来控制高血压', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b48b6c3010148f8135a700004', null, '近期气温波动大，糖友注意血糖监测', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410101121309920.jpg', '2', '<p>　　近期气温波动比较大，不少糖尿病患者的血糖也随之出现了波动，有人甚至因此调整了血糖监测的频率。血糖监测是糖尿病管理中非常重要的环节，但又常被患者所忽视。一项调查显示，我国Ⅱ型糖尿病患者中，血糖控制达标率仅为25%，胰岛素治疗者进行自我血糖监测的仅占32%。事实上，一天24小时内，人体的血糖水平始终处于波动之中。如果不能及时了解自身的血糖状况，那么饮食、锻炼、治疗方面的努力都会变得徒劳，更谈不上对糖尿病进行科学有效的自我管理。</p>\r\n\r\n<p>　　餐后血糖高，伤害大血管</p>\r\n\r\n<p>　　受饮食习惯等因素的影响，我国的糖尿病餐后血糖升高较明显，尤其是老年患者，只查空腹血糖，60%~70%的早期患者会漏诊。事实上，餐后高血糖长期升高可引起微血管及大血管病变，这是由于葡萄糖毒性作用造成的。餐后高血糖以及血糖波动，可导致血管内皮损伤。血管内皮的损伤，会引起动脉粥样硬化或加重粥样硬化进程。进而可导致血栓形成，严重威胁心脑血管健康。因此对于餐后血糖的监测也相当重要。</p>\r\n\r\n<p>　　血糖波动大的，不妨连续4天测7个时点的血糖</p>\r\n\r\n<p>　　一项为期10年的糖尿病控制并发症实验（DCCT）研究显示：理想的血糖控制可使眼睛病变减少76%，肾脏病变降低50%，神经病变减低60%，对已患此类并发症的病人，理想的血糖控制可延缓一半以上眼病及肾病的恶化。门诊中，医生发现，有些患者虽然有意识坚持血糖监测，但方法常常不得当，比如有人固定只测早上的空腹血糖，有人一天中测的时间比较随机。事实上，血糖监测的时间也是有讲究的。</p>\r\n\r\n<p>　　如果患者的血糖波动较大，可以采取多点监测。比如第1天，监测早餐前、餐后2小时血糖，其他时点不测；第2天，监测中餐前、餐后2小时血糖，其他时点不测；第3天，监测晚餐前、餐后2小时血糖，其他时点不测；第4天，监测睡前（晚10：30）血糖，其他时点不测。这个方案的优点在于4天测了7个时点的血糖数值，而且，长期来看，还大大节约了试纸、降低了花费。因此，对于血糖波动较大且近期打算去看医生时，建议去之前连续4天完成上述的血糖监测并做好记录带上随诊，这样有助于医生调整治疗方案。</p>\r\n\r\n<p>　　小贴士</p>\r\n\r\n<p>　　&ldquo;会说话&rdquo;的血糖仪</p>\r\n\r\n<p>　　更适合老年人</p>\r\n\r\n<p>　　有些患者没有坚持监测血糖，是担心自己不会使用复杂的血糖仪，或者即使监测出来血糖值，自己也看不懂。其实，这种顾虑根本不必有，随着技术的进步，如今的血糖仪已相当人性化，有些甚至可以实现自动语音播报。这种&ldquo;会说话&rdquo;的血糖仪在中医养生俱乐部的会员中拥有超高人气。它在监测过程能实现自动语音播报，数据显示也是清晰易读，更利于老年人使用。同时它能计算7天、12天、28天的平均血糖监测值，方便定期监测结果，制订个性化治疗方案；测量结果会自动储存，并且拥有突然断电记忆保护功能。</p>\r\n', '2014-10-10 11:21:30', '1', '近期气温波动大，糖友注意血糖监测', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b48b6c3010148f81645920005', null, '如何保证自测血压的准确率', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410101124422430.jpg', '1', '核心提示：现在许多<strong><a href=\"http://www.xkare.cn/\">高血压</a></strong>患者自备有血压计，但是经常会出现患者自测的血压数值与在医院由医务人员所测的血压数值不一致。这是为什么呢？<br />\r\n　　近年来，随着生活水平的提高和卫生知识的普及，许多<strong><a href=\"http://www.xkare.cn/\">高血压</a></strong>患者都自备有血压计。那么，如何正确使用血压计和测量血压呢？<br />\r\n　　(1)室内要保持安静，室温最好保持在20℃左右。<br />\r\n　　(2)在测量前，受检者要精神放松，最好休息20～30分钟，排空膀胱，不饮酒、咖啡和浓茶，并要停止吸烟。<br />\r\n　　(3)病人可采取坐式或卧式，两脚平放，其肘部及前臂舒适地放在与心脏大约平行的位置上。<br />\r\n　　(4)打开血压计盒，放在病人肢体近旁的平稳处，并使水银柱垂直到零点。<br />\r\n　　(5)让病人脱下衣袖露出右上臂，如衣袖单薄宽大，可向上卷到腋窝处。<br />\r\n　　(6)在缠血压计气袖时，先将气袖内空气挤出，再缠在右上臂肘关节上2～3公分处，不能太松或太紧。在肘窝内侧摸到肱动脉跳动后，将听诊器听头放在肱动脉上，打气测压。<br />\r\n　　(7)关紧气球上的气门，测量者的视线应与水银柱上的刻度在一个水平上，来观察水银柱的高度。快速充气，待触知桡动脉脉搏消失后，再加压4kPa(30mmHg)即可停止充气，微开气阀门，使水银缓缓下降，当听到第一声脉搏跳动的声音时为&quot;高压&quot;，即收缩压。继续微微放气，水银缓缓下降到水银柱上的某一刻度，声音突然变弱或消失时为&quot;低压&quot;，即舒张压。<br />\r\n　　(8)第一次测量完成后应完全放气，至少等一分钟后，再重复测量一次，取两次的平均值为所得到的血压值。此外，如果要确定是否患<strong><a href=\"http://www.xkare.cn/\">高血压</a></strong>，最好还要在不同的时间里进行测量，一般认为，至少有3次不同日的偶测血压值，才可以定为<strong><a href=\"http://www.xkare.cn/\">高血压</a></strong>。<br />\r\n　　(9)整理好袖带、听诊器，把水银柱恢复至零点关闭，以备再用。<br />\r\n　　注意事项：①打气时看袖带是否从旁鼓出，若鼓出应重新缠紧，以免产生误差。②对脑血管意外偏瘫病人，应在健侧上肢测量。因患肢血管可能不正常，以致血压测量不准确。③初诊病人应根据病情分别测左右两上肢血压，以作对照。青年<strong><a href=\"http://www.xkare.cn/\">高血压</a></strong>病人可测量上下肢血压以便比较。', '2014-10-10 11:24:42', '1', '如何保证自测血压的准确率', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b48b6c3010148f81852b90006', null, '糖尿病低血糖的典型症状', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410101126566970.jpg', '2', '核心提示：低血糖的临床表现与血糖水平以及血糖的下降速度有关，可表现为交感神经兴奋（如心悸、焦虑、出汗、饥饿感、皮肤感觉异常等）和中枢神经症状（如神志改变、认知障碍、抽搐和昏迷）。<br />\r\n　　很多<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>患者应该都听过医生这样的告诫，注意低血糖，一次低血糖的危害比高血糖的危害要更直接更大。<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>低血糖是<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>患者最常见的并发症，严重可导致患者死亡。由于<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>低血糖的发展比较缓慢，如患者不了解<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>低血糖有什么症状，并及时采取治疗的话，严重可导致患者的生命受到危及，所以患者应重视。<br />\r\n　　<strong>低血糖的发展阶段和症状</strong><br />\r\n　 　<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>专家介绍，低血糖是<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>治疗过程中可能发生的严重并发症，常见于老年、肾功能减退以及有严重微血管和大血管并发症的患者，是血糖控制达标过程中 应该特别注意的问题。但是每个阶段的症状表现以及危害都不一样，所以患者应主动了解<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>低血糖的发展阶段，以便采取治疗，避免危害发生。<br />\r\n　　那么，<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>低血糖的发展阶段是怎样的呢？以下是专家的介绍：<br />\r\n　　1、交感神经过度兴奋阶段：<br />\r\n　　主要表现为心慌、出汗、面色苍白、软弱无力肢凉手抖、饥饿感、头晕等等。<br />\r\n　　2、神经缺糖阶段：<br />\r\n　　可出现各种精神异常的表现，如注意力涣散、反应迟钝、言语增多、思维混乱、答非所问、兴奋躁动、神志恍惚、幻觉等等，此时常被误认为精神病，而贻误治疗。<br />\r\n　　3、意识丧失阶段：<br />\r\n　　患者完全失去知觉，发生抽搐乃至昏迷，最后变成植物人，甚至死亡。<br />\r\n<strong>　　<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>低血糖的诊断标准</strong><br />\r\n　　低血糖的临床表现与血糖水平以及血糖的下降速度有关，可表现为交感神经兴奋（如心悸、焦虑、出汗、饥饿感、皮肤感觉异常等）和中枢神经症状（如神志改变、认知障碍、抽搐和昏迷）。<br />\r\n　　但是老年患者发生低血糖时可表现为行为异常或其他非典型症状。夜间低血糖常常难以发现和及时处理。有些病人屡发低血糖后，可表现为无先兆症状的低血糖昏迷。<br />\r\n　　DCCT和UKPDS等临床研究显示，严格的血糖控制会增加低血糖的风险。因而对<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>患者需要制定个体化的血糖控制目标。<br />\r\n&nbsp;　　对非<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>的患者来说，低血糖的标准为小于2.8mmol/L。而<strong><a href=\"http://www.xkare.cn/\">糖尿病</a></strong>患者只要血糖值&le;3.9mmol/L就属低血糖范畴。<br />\r\n　　世界卫生组织规定的低血糖症诊断标准是：<br />\r\n1、具有低血糖的症状;<br />\r\n2、血糖&le;2.8mm01/L(50mg/d1);<br />\r\n3、服糖(即碳水化合物)后可使症状迅速缓解。', '2014-10-10 11:26:56', '1', '糖尿病低血糖的典型症状', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b48b6c3010148f81b95240007', null, '高血糖的危害及防治', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410101130302920.jpg', '2', '<p>血液中的糖分称为血糖，绝大多数情况下都是葡萄糖（英文简写GLU）。体内各组织细胞活动所需的能量大部分来自葡萄糖，所以血糖必须保持一定的水平才能维持体内各器官和组织的需要。</p>\r\n\r\n<p>正常人空腹（8小时内无糖及任何含糖食物摄入）血糖浓度为3.9至6.1mmol/L，餐后两小时血糖浓度为7.8至11.1mmol/L。当空腹血糖高于正常范围，称为高血糖，餐后两小时血糖高于正常范围7.8mmol/L，也可以称为高血糖。</p>\r\n\r\n<p>但是，高血糖不是一种疾病的诊断，只是一种血糖检测结果的判定，血糖检测是一时性的结果，高血糖不等同糖尿病。所以检查出是高血糖，不要过于担心。间隔一段时间后，再次检查看看血糖结果，确定引起高血糖的原因：</p>\r\n\r\n<p>一、偶然的高血糖</p>\r\n\r\n<p>血糖检查前如果食用大量的甜食，当然会出现血糖高的结果。</p>\r\n\r\n<p>二、不良生活习惯和环境</p>\r\n\r\n<p>如现在的年轻人大部分都很喜欢<a href=\"http://finance.ifeng.com/company/data/news/40.shtml\" style=\"text-decoration: none; color: rgb(0, 66, 118); font-weight: bold;\" target=\"_blank\">肯德基</a>一类的快餐，不喜蔬菜和水果，长久的饮食习惯也可能导致血糖偏高。</p>\r\n\r\n<p>三、其他疾病亦会引起高血糖</p>\r\n\r\n<p>如冠心病等与高血糖有着紧密的联系。</p>\r\n\r\n<p>四、糖尿病的早期症状</p>\r\n\r\n<p>在排除了以上的引起高血糖的诱因之后，那么高血糖就极有可能是糖尿病的早期症状。目前，糖尿病患病人群已经越来越年轻，甚至出现儿童糖尿病。</p>\r\n\r\n<p>短时间、一次性的高血糖对人体无严重损害。比如在应激状态下或情绪激动、高度紧张时，可出现短暂的高血糖；一次进食大量的糖类，也可出现短暂高血糖；随后，血糖水平逐渐恢复正常。然而长期的高血糖会使全身各个组织器官发生病变，导致急慢性并发症的发生。高血糖可引起微血管病变，使患者的微循环有不同程度的异常。随着病程的延长和治疗不及时，会促使微血管病变得加重和发展，使患者致盲、致残。微血管病变主要表现在视网膜、肾、心肌、神经组织及足趾，使患者身受病痛折磨。高血糖还会引起大血管病变。糖尿病性大血管病变是指主动脉、冠状动脉、脑基底动脉、肾动脉及周围动脉等动脉粥样硬化。其中，动脉粥样硬化症病情较重、病死率高，约70％至80％糖尿病患者死于糖尿病性大血管病变。</p>\r\n\r\n<p>所以一旦确诊是高血糖，应该尽量清楚是什么原因引起的高血糖，并做好预防和治疗工作：</p>\r\n\r\n<p>一、药物治疗</p>\r\n\r\n<p>分为口服降糖药和胰岛素注射两种。患者具体使用何种药物，需医生根据血糖情况、经济状况、自身体质等多方面考虑，不要乱用药，结果延误病情的最佳治疗时机。</p>\r\n\r\n<p>二、适当运动，合理饮食</p>\r\n\r\n<p>每位患者都知道适当运动和饮食控制。但是，大部分患者都不能准确掌握自己的运动量和饮食热量规范，同时不能坚持下来。</p>\r\n\r\n<p>应遵照医生或营养专家的意见根据自己的年龄、体质、病情制定个体化饮食方案和运动方案，并坚持方案的实施。</p>\r\n\r\n<p>三、血糖监测同样重要</p>\r\n\r\n<p>因为对于糖友来说，血糖监测有利于糖尿病控制，尤其餐后两小时血糖，而且血糖较尿糖测试更准确。尿糖检测影响因素较多，误差大，不如血糖精确，而且对低血糖无任何价值。认真记录日常的血糖值变化情况，可以更简捷地防止血糖过高、过低，有助于制定最佳治疗方案，及时调整治疗程序，从而控制空腹及餐后血糖达标，减少、减缓糖尿病并发症的发生发展。</p>\r\n', '2014-10-10 11:30:30', '1', '高血糖的危害及防治', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b494add6a0149557720ea0000', null, 'Background information on high blood pressure', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410281435109540.jpg', '4', 'Hypertension&nbsp;is&nbsp;very&nbsp;common&nbsp;indeed&nbsp;and&nbsp;hence&nbsp;a&nbsp;major&nbsp;public&nbsp;health&nbsp;issue.&nbsp;The&nbsp;prevalence&nbsp;is&nbsp;expected&nbsp;to&nbsp;increase&nbsp;considerably&nbsp;in&nbsp;the&nbsp;coming&nbsp;years.&nbsp;In&nbsp;2000,&nbsp;the&nbsp;estimated&nbsp;number&nbsp;of&nbsp;adults&nbsp;living&nbsp;with&nbsp;high&nbsp;blood&nbsp;pressure&nbsp;globally&nbsp;was&nbsp;972&nbsp;million.&nbsp;This&nbsp;is&nbsp;expected&nbsp;to&nbsp;increase&nbsp;to&nbsp;1.56&nbsp;billion&nbsp;by&nbsp;2025!&nbsp;Lifestyle&nbsp;factors,&nbsp;such&nbsp;as&nbsp;physical&nbsp;inactivity,&nbsp;a&nbsp;salt-rich&nbsp;diet&nbsp;with&nbsp;high&nbsp;processed&nbsp;and&nbsp;fatty&nbsp;foods,&nbsp;and&nbsp;alcohol&nbsp;and&nbsp;tobacco&nbsp;use,&nbsp;are&nbsp;reasons&nbsp;for&nbsp;this&nbsp;increased&nbsp;disease&nbsp;burden,&nbsp;which&nbsp;is&nbsp;spreading&nbsp;at&nbsp;an&nbsp;alarming&nbsp;rate&nbsp;from&nbsp;developed&nbsp;countries&nbsp;to&nbsp;emerging&nbsp;economies,&nbsp;such&nbsp;as&nbsp;India,&nbsp;China&nbsp;and&nbsp;African&nbsp;countries.<br />\r\nAdequate&nbsp;treatment&nbsp;of&nbsp;high&nbsp;blood&nbsp;pressure&nbsp;lowers&nbsp;this&nbsp;cardiovascular&nbsp;risk&nbsp;towards&nbsp;normal&nbsp;levels.&nbsp;However,&nbsp;the&nbsp;biggest&nbsp;problem&nbsp;for&nbsp;controlling&nbsp;hypertension&nbsp;is&nbsp;compliance&nbsp;with&nbsp;treatment.&nbsp;Despite&nbsp;very&nbsp;effective&nbsp;and&nbsp;cost-effective&nbsp;treatments,&nbsp;target&nbsp;blood&nbsp;pressure&nbsp;levels&nbsp;are&nbsp;very&nbsp;rarely&nbsp;reached,&nbsp;even&nbsp;in&nbsp;countries&nbsp;where&nbsp;cost&nbsp;of&nbsp;medication&nbsp;is&nbsp;not&nbsp;an&nbsp;issue.&nbsp;Sadly,&nbsp;many&nbsp;patients&nbsp;still&nbsp;believe&nbsp;that&nbsp;hypertension&nbsp;is&nbsp;a&nbsp;disease&nbsp;that&nbsp;can&nbsp;be&nbsp;&#39;cured&#39;,&nbsp;and&nbsp;they&nbsp;stop&nbsp;or&nbsp;reduce&nbsp;medication&nbsp;when&nbsp;their&nbsp;blood&nbsp;pressure&nbsp;levels&nbsp;fall&nbsp;to&nbsp;normal&nbsp;levels.&nbsp;Despite&nbsp;the&nbsp;availability&nbsp;of&nbsp;effective&nbsp;and&nbsp;safe&nbsp;antihypertensive&nbsp;drugs,&nbsp;hypertension&nbsp;and&nbsp;its&nbsp;related&nbsp;risk&nbsp;factors&nbsp;(obesity,&nbsp;high&nbsp;blood&nbsp;lipids,&nbsp;and&nbsp;diabetes&nbsp;mellitus)&nbsp;remain&nbsp;uncontrolled&nbsp;in&nbsp;many&nbsp;patients.&nbsp;One&nbsp;often&nbsp;talks&nbsp;about&nbsp;&#39;the&nbsp;rule&nbsp;of&nbsp;the&nbsp;halves&#39;:&nbsp;Only&nbsp;one&nbsp;half&nbsp;of&nbsp;the&nbsp;patients&nbsp;with&nbsp;high&nbsp;blood&nbsp;pressure&nbsp;in&nbsp;a&nbsp;population&nbsp;have&nbsp;been&nbsp;diagnosed,&nbsp;only&nbsp;half&nbsp;of&nbsp;those&nbsp;detected&nbsp;have&nbsp;been&nbsp;treated,&nbsp;and&nbsp;only&nbsp;half&nbsp;of&nbsp;those&nbsp;treated&nbsp;have&nbsp;been&nbsp;adequately&nbsp;treated&nbsp;to&nbsp;a&nbsp;normal&nbsp;blood&nbsp;pressure.<br />\r\nThe&nbsp;members&nbsp;of&nbsp;the&nbsp;International&nbsp;Society&nbsp;of&nbsp;Hypertension&nbsp;(ISH),&nbsp;founded&nbsp;some&nbsp;40&nbsp;years&nbsp;ago,&nbsp;have&nbsp;worked&nbsp;hard&nbsp;to&nbsp;improve&nbsp;these&nbsp;sad&nbsp;results,&nbsp;and&nbsp;there&nbsp;has&nbsp;been&nbsp;some&nbsp;progress.&nbsp;However,&nbsp;physicians&nbsp;and&nbsp;practitioners&nbsp;worldwide&nbsp;need&nbsp;to&nbsp;convey&nbsp;the&nbsp;message&nbsp;better&nbsp;to&nbsp;the&nbsp;public&nbsp;that&nbsp;high&nbsp;blood&nbsp;pressure&nbsp;is&nbsp;the&nbsp;first&nbsp;sign&nbsp;that&nbsp;many&nbsp;organs&nbsp;in&nbsp;the&nbsp;body&nbsp;are&nbsp;under&nbsp;attack.&nbsp;This&nbsp;message&nbsp;should&nbsp;make&nbsp;people&nbsp;think&nbsp;more&nbsp;carefully&nbsp;about&nbsp;the&nbsp;consequences&nbsp;of&nbsp;an&nbsp;unhealthy&nbsp;lifestyle&nbsp;and&nbsp;give&nbsp;preventative&nbsp;measures&nbsp;a&nbsp;real&nbsp;chance&nbsp;by&nbsp;staying&nbsp;on&nbsp;treatment.<br />\r\nControl&nbsp;of&nbsp;high&nbsp;blood&nbsp;pressure&nbsp;in&nbsp;the&nbsp;population&nbsp;is&nbsp;very&nbsp;important&nbsp;indeed&nbsp;and&nbsp;the&nbsp;benefit&nbsp;for&nbsp;the&nbsp;public&nbsp;is&nbsp;very&nbsp;large!&nbsp;Lifestyle&nbsp;changes&nbsp;that&nbsp;individuals&nbsp;can&nbsp;make&nbsp;for&nbsp;themselves&nbsp;to&nbsp;improve&nbsp;their&nbsp;blood&nbsp;pressure&nbsp;include:<br />\r\n&middot;&nbsp;Losing&nbsp;weight&nbsp;if&nbsp;they&nbsp;are&nbsp;overweight<br />\r\n&middot;&nbsp;Eating&nbsp;more&nbsp;polyunsaturated&nbsp;fat<br />\r\n&middot;&nbsp;Reducing&nbsp;the&nbsp;salt&nbsp;content&nbsp;of&nbsp;their&nbsp;diet<br />\r\n&middot;&nbsp;Taking&nbsp;regular&nbsp;exercise<br />\r\n&middot;&nbsp;Making&nbsp;sure&nbsp;that&nbsp;they&nbsp;are&nbsp;sensible&nbsp;about&nbsp;their&nbsp;alcohol&nbsp;intake', '2014-10-28 14:35:10', '1', 'Background information on high blood pressure', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b494add6a01495579d7210001', null, 'WHO calls for salt reduction to save millions of lives', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410281438086730.jpg', '4', 'On&nbsp;the&nbsp;occasion&nbsp;of&nbsp;Sept.&nbsp;29&nbsp;World&nbsp;Heart&nbsp;Day,&nbsp;the&nbsp;World&nbsp;Health&nbsp;Organization&nbsp;(WHO)&nbsp;on&nbsp;Thursday&nbsp;called&nbsp;for&nbsp;reducing&nbsp;salt&nbsp;intake&nbsp;to&nbsp;cut&nbsp;the&nbsp;number&nbsp;of&nbsp;people&nbsp;experiencing&nbsp;heart&nbsp;disease&nbsp;and&nbsp;stroke&nbsp;and&nbsp;in&nbsp;turn&nbsp;save&nbsp;lives.<br />\r\nNon-communicable&nbsp;diseases,&nbsp;including&nbsp;heart&nbsp;diseases&nbsp;and&nbsp;stroke,&nbsp;are&nbsp;the&nbsp;leading&nbsp;causes&nbsp;of&nbsp;premature&nbsp;death&nbsp;in&nbsp;21st&nbsp;century.<br />\r\nAccording&nbsp;to&nbsp;WHO&#39;s&nbsp;Global&nbsp;Action&nbsp;Plan&nbsp;to&nbsp;reduce&nbsp;Non-communicable&nbsp;diseases,&nbsp;reducing&nbsp;global&nbsp;salt&nbsp;intake&nbsp;by&nbsp;a&nbsp;relative&nbsp;30&nbsp;percent&nbsp;by&nbsp;2025&nbsp;is&nbsp;one&nbsp;of&nbsp;the&nbsp;important&nbsp;targets.<br />\r\n&quot;If&nbsp;the&nbsp;target&nbsp;to&nbsp;reduce&nbsp;salt&nbsp;by&nbsp;30&nbsp;percent&nbsp;globally&nbsp;by&nbsp;2025&nbsp;is&nbsp;achieved,&nbsp;millions&nbsp;of&nbsp;lives&nbsp;can&nbsp;be&nbsp;saved&nbsp;from&nbsp;heart&nbsp;disease,&nbsp;stroke&nbsp;and&nbsp;related&nbsp;conditions,&quot;&nbsp;Oleg&nbsp;Chestnov,&nbsp;WHO&nbsp;assistant&nbsp;director-general,&nbsp;said&nbsp;in&nbsp;a&nbsp;statement.<br />\r\nConsuming&nbsp;too&nbsp;much&nbsp;salt&nbsp;can&nbsp;lead&nbsp;to&nbsp;high&nbsp;blood&nbsp;pressure,&nbsp;and&nbsp;greatly&nbsp;increase&nbsp;the&nbsp;risk&nbsp;of&nbsp;heart&nbsp;disease&nbsp;and&nbsp;stroke.&nbsp;Chestnov&nbsp;noted&nbsp;that&nbsp;reducing&nbsp;salt&nbsp;intake&nbsp;is&nbsp;one&nbsp;of&nbsp;the&nbsp;most&nbsp;effective&nbsp;ways&nbsp;to&nbsp;improve&nbsp;population&nbsp;health.<br />\r\nHowever,&nbsp;WHO&nbsp;said&nbsp;people&nbsp;consume&nbsp;around&nbsp;10&nbsp;grams&nbsp;of&nbsp;salt&nbsp;per&nbsp;day,&nbsp;almost&nbsp;doubles&nbsp;the&nbsp;WHO&#39;s&nbsp;recommended&nbsp;level&nbsp;of&nbsp;salt&nbsp;intake.<br />\r\nWHO&nbsp;urged&nbsp;food&nbsp;industry&nbsp;to&nbsp;work&nbsp;closely&nbsp;with&nbsp;national&nbsp;governments&nbsp;to&nbsp;incrementally&nbsp;reduce&nbsp;the&nbsp;level&nbsp;of&nbsp;salt&nbsp;in&nbsp;food&nbsp;products.<br />\r\nWHO&#39;s&nbsp;evidence-based&nbsp;strategies&nbsp;to&nbsp;reduce&nbsp;salt&nbsp;consumption&nbsp;are&nbsp;including&nbsp;ensuring&nbsp;food&nbsp;manufactures&nbsp;reduce&nbsp;the&nbsp;levels&nbsp;of&nbsp;salt&nbsp;in&nbsp;food&nbsp;and&nbsp;beverage&nbsp;products&nbsp;and&nbsp;making&nbsp;healthy&nbsp;food&nbsp;available&nbsp;and&nbsp;affordable,&nbsp;fostering&nbsp;healthy&nbsp;eating&nbsp;environments&nbsp;in&nbsp;public&nbsp;places,&nbsp;as&nbsp;well&nbsp;as&nbsp;ensuring&nbsp;clear&nbsp;food&nbsp;labeling&nbsp;so&nbsp;consumers&nbsp;can&nbsp;easily&nbsp;understand&nbsp;the&nbsp;level&nbsp;of&nbsp;salt&nbsp;in&nbsp;products.<br />\r\nFor&nbsp;individuals&nbsp;and&nbsp;families,&nbsp;WHO&nbsp;recommended&nbsp;to&nbsp;remove&nbsp;salt&nbsp;dispensers&nbsp;and&nbsp;bottled&nbsp;sauces&nbsp;form&nbsp;dining&nbsp;tables,&nbsp;limit&nbsp;the&nbsp;amount&nbsp;of&nbsp;salt&nbsp;added&nbsp;in&nbsp;cooking&nbsp;and&nbsp;frequent&nbsp;consumption&nbsp;of&nbsp;high&nbsp;salt&nbsp;products,&nbsp;and&nbsp;guide&nbsp;children&#39;s&nbsp;taste&nbsp;buds&nbsp;through&nbsp;a&nbsp;diet&nbsp;of&nbsp;mostly&nbsp;unprocessed&nbsp;foods&nbsp;without&nbsp;adding&nbsp;salt.', '2014-10-28 14:38:08', '1', 'WHO calls for salt reduction to save millions of lives', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b494add6a0149557cd4d10002', null, 'People should monitor waistline for diabetes risk', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410281441246890.jpg', '5', 'Public&nbsp;Health&nbsp;England&nbsp;(PHE),&nbsp;an&nbsp;executive&nbsp;agency&nbsp;of&nbsp;the&nbsp;Department&nbsp;of&nbsp;Health,&nbsp;released&nbsp;a&nbsp;report&nbsp;on&nbsp;Thursday&nbsp;containing&nbsp;new&nbsp;analysis&nbsp;showing&nbsp;adults&nbsp;with&nbsp;a&nbsp;large&nbsp;waist&nbsp;are&nbsp;five&nbsp;times&nbsp;more&nbsp;likely&nbsp;to&nbsp;get&nbsp;type&nbsp;2&nbsp;diabetes<br />\r\nPHE&nbsp;said&nbsp;they&nbsp;encourage&nbsp;people&nbsp;to&nbsp;monitor&nbsp;their&nbsp;waistline&nbsp;and&nbsp;assess&nbsp;their&nbsp;risk&nbsp;of&nbsp;developing&nbsp;type&nbsp;2&nbsp;diabetes,&nbsp;which&nbsp;has&nbsp;been&nbsp;a&nbsp;serious&nbsp;public&nbsp;health&nbsp;issue&nbsp;in&nbsp;many&nbsp;countries.<br />\r\nAccording&nbsp;to&nbsp;the&nbsp;report,&nbsp;men&nbsp;who&nbsp;have&nbsp;a&nbsp;large&nbsp;waist&nbsp;circumference&nbsp;of&nbsp;over&nbsp;102cm&nbsp;are&nbsp;five&nbsp;times&nbsp;more&nbsp;likely&nbsp;to&nbsp;develop&nbsp;type&nbsp;2&nbsp;diabetes.&nbsp;Women&nbsp;with&nbsp;a&nbsp;large&nbsp;waist&nbsp;circumference&nbsp;of&nbsp;over&nbsp;88cm&nbsp;are&nbsp;three&nbsp;times&nbsp;more&nbsp;likely&nbsp;to&nbsp;develop&nbsp;type&nbsp;2&nbsp;diabetes.<br />\r\nExperts&nbsp;in&nbsp;PHE&nbsp;said&nbsp;that&nbsp;currently&nbsp;90&nbsp;percent&nbsp;of&nbsp;adults&nbsp;with&nbsp;type&nbsp;2&nbsp;diabetes&nbsp;are&nbsp;overweight&nbsp;or&nbsp;obese,&nbsp;and&nbsp;the&nbsp;prevalence&nbsp;of&nbsp;both&nbsp;obesity&nbsp;and&nbsp;diabetes&nbsp;are&nbsp;on&nbsp;the&nbsp;increase.&nbsp;Being&nbsp;overweight&nbsp;or&nbsp;obese&nbsp;is&nbsp;the&nbsp;main&nbsp;avoidable&nbsp;risk&nbsp;factor&nbsp;for&nbsp;type&nbsp;2&nbsp;diabetes.<br />\r\nThe&nbsp;report&nbsp;also&nbsp;revealed&nbsp;that&nbsp;deprivation&nbsp;is&nbsp;closely&nbsp;linked&nbsp;to&nbsp;the&nbsp;risk&nbsp;of&nbsp;both&nbsp;obesity&nbsp;and&nbsp;diabetes&nbsp;in&nbsp;Britain,&nbsp;with&nbsp;type&nbsp;2&nbsp;diabetes&nbsp;being&nbsp;40&nbsp;percent&nbsp;more&nbsp;common&nbsp;among&nbsp;people&nbsp;in&nbsp;the&nbsp;poorest&nbsp;communities&nbsp;compared&nbsp;with&nbsp;those&nbsp;in&nbsp;the&nbsp;riches.<br />\r\n&ldquo;Type&nbsp;2&nbsp;diabetes&nbsp;is&nbsp;a&nbsp;very&nbsp;serious&nbsp;public&nbsp;health&nbsp;issue&nbsp;which&nbsp;can&nbsp;have&nbsp;significant&nbsp;consequences,&nbsp;such&nbsp;as&nbsp;limb&nbsp;amputations&nbsp;or&nbsp;blindness.&rdquo;&nbsp;Dr.&nbsp;Alison&nbsp;Tedstone,&nbsp;chief&nbsp;nutritionist&nbsp;at&nbsp;PHE,&nbsp;said.<br />\r\n&ldquo;The&nbsp;key&nbsp;to&nbsp;reducing&nbsp;your&nbsp;chances&nbsp;of&nbsp;type&nbsp;2&nbsp;diabetes&nbsp;is&nbsp;losing&nbsp;weight&nbsp;which&nbsp;can&nbsp;be&nbsp;achieved&nbsp;through&nbsp;a&nbsp;healthy&nbsp;diet&nbsp;and&nbsp;being&nbsp;more&nbsp;active,&rdquo;&nbsp;she&nbsp;added.', '2014-10-28 14:41:24', '1', 'People should monitor waistline for diabetes risk', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b494add6a0149557e2b870003', null, 'What is Hypoglycemia ?', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410281442524230.jpg', '5', 'Most&nbsp;of&nbsp;us&nbsp;at&nbsp;one&nbsp;time&nbsp;or&nbsp;another&nbsp;experience&nbsp;a&nbsp;degree&nbsp;of&nbsp;low&nbsp;blood&nbsp;sugar.&nbsp;If&nbsp;we&nbsp;are&nbsp;tired&nbsp;or&nbsp;moody&nbsp;because&nbsp;we&nbsp;have&nbsp;not&nbsp;eaten&nbsp;for&nbsp;many&nbsp;hours,&nbsp;it&nbsp;is&nbsp;a&nbsp;sign&nbsp;that&nbsp;our&nbsp;blood&nbsp;sugar&nbsp;is&nbsp;low.&nbsp;Yet&nbsp;chronic&nbsp;hypoglycemia&nbsp;is&nbsp;more&nbsp;than&nbsp;mere&nbsp;moodiness&nbsp;associated&nbsp;with&nbsp;a&nbsp;lack&nbsp;of&nbsp;food.&nbsp;It&nbsp;is&nbsp;a&nbsp;sign&nbsp;that&nbsp;the&nbsp;organs&nbsp;that&nbsp;help&nbsp;balance&nbsp;blood&nbsp;sugar,&nbsp;such&nbsp;as&nbsp;the&nbsp;adrenal&nbsp;glands&nbsp;and&nbsp;the&nbsp;pancreas,&nbsp;aren&#39;t&nbsp;doing&nbsp;a&nbsp;good&nbsp;enough&nbsp;job.&nbsp;Fortunately,&nbsp;the&nbsp;symptoms&nbsp;of&nbsp;hypoglycemia&nbsp;can&nbsp;be&nbsp;eliminated&nbsp;with&nbsp;a&nbsp;diet&nbsp;of&nbsp;whole&nbsp;foods,&nbsp;frequent&nbsp;meals,&nbsp;and&nbsp;carefully&nbsp;chosen&nbsp;nutritional&nbsp;Supplements.<br />\r\nHYPOGLYCEMIA&nbsp;OR&nbsp;LOW&nbsp;BLOOD&nbsp;SUGAR&nbsp;refers&nbsp;to&nbsp;the.&nbsp;body&#39;s&nbsp;inability&nbsp;to&nbsp;maintain&nbsp;normal&nbsp;levels&nbsp;of&nbsp;sugar&nbsp;in&nbsp;the&nbsp;blood.&nbsp;Sugar&nbsp;is&nbsp;the&nbsp;main&nbsp;source&nbsp;of&nbsp;fuel&nbsp;for&nbsp;the&nbsp;body,&nbsp;and&nbsp;sugar&nbsp;levels&nbsp;must&nbsp;remain&nbsp;steady.&nbsp;Otherwise,&nbsp;the&nbsp;brain&nbsp;and&nbsp;other&nbsp;organs&nbsp;cannot&nbsp;function&nbsp;normally.&nbsp;When&nbsp;sugar&nbsp;levels&nbsp;become&nbsp;undesirably&nbsp;low,&nbsp;as&nbsp;can&nbsp;occur&nbsp;between&nbsp;meals&nbsp;or&nbsp;soon&nbsp;after&nbsp;sweets&nbsp;are&nbsp;eaten,&nbsp;the&nbsp;following&nbsp;problems&nbsp;can&nbsp;occur:<br />\r\nFood&nbsp;cravings,&nbsp;especially&nbsp;for&nbsp;sugar&nbsp;and&nbsp;starchy&nbsp;foods<br />\r\nDepression<br />\r\nFatigue<br />\r\nHeadaches', '2014-10-28 14:42:52', '1', 'What is Hypoglycemia ?', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b494add6a0149557fd07d0004', null, 'Lowering Blood Pressure Naturally', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201410281444401890.jpg', '4', 'High&nbsp;blood&nbsp;pressure&nbsp;is&nbsp;often&nbsp;accompanied&nbsp;by&nbsp;high&nbsp;blood&nbsp;levels&nbsp;of&nbsp;insulin.&nbsp;High&nbsp;insulin&nbsp;levels&nbsp;may&nbsp;cause&nbsp;high&nbsp;blood&nbsp;pressure.&nbsp;High&nbsp;levels&nbsp;of&nbsp;insulin&nbsp;will&nbsp;also&nbsp;make&nbsp;weight&nbsp;loss&nbsp;more&nbsp;difficult.&nbsp;A&nbsp;diet&nbsp;high&nbsp;in&nbsp;carbohydrates&nbsp;may&nbsp;not&nbsp;be&nbsp;ideal&nbsp;for&nbsp;hypertensives,&nbsp;for&nbsp;it&nbsp;will&nbsp;perpetuate&nbsp;high&nbsp;insulin&nbsp;levels.&nbsp;It&nbsp;will&nbsp;also&nbsp;worsen&nbsp;food&nbsp;cravings.&nbsp;Hypertensives&nbsp;who&nbsp;are&nbsp;overweight&nbsp;should&nbsp;restrict&nbsp;carbohydrates-grains,&nbsp;beans,&nbsp;legumes,&nbsp;and&nbsp;fruits&nbsp;-&nbsp;to&nbsp;no&nbsp;more&nbsp;than&nbsp;40%&nbsp;of&nbsp;their&nbsp;diet&nbsp;in&nbsp;an&nbsp;effort&nbsp;to&nbsp;get&nbsp;their&nbsp;insulin&nbsp;levels&nbsp;back&nbsp;to&nbsp;normal.<br />\r\nHIGH&nbsp;BLOOD&nbsp;PRESSURE&nbsp;PATIENTS&nbsp;ARE&nbsp;often&nbsp;told&nbsp;that&nbsp;they&nbsp;must&nbsp;stay&nbsp;on&nbsp;their&nbsp;medication&nbsp;for&nbsp;life.&nbsp;That&#39;s&nbsp;like&nbsp;telling&nbsp;you&nbsp;once&nbsp;your&nbsp;car&nbsp;burns&nbsp;oil,&nbsp;it&nbsp;always&nbsp;will&nbsp;and&nbsp;you&nbsp;should&nbsp;buy&nbsp;more&nbsp;oil&nbsp;every&nbsp;week.&nbsp;There&nbsp;is&nbsp;a&nbsp;conflict&nbsp;of&nbsp;interest.<br />\r\nHigh&nbsp;blood&nbsp;pressure&nbsp;is&nbsp;unknown&nbsp;in&nbsp;primitive&nbsp;cultures&nbsp;that&nbsp;eat&nbsp;a&nbsp;diet&nbsp;of&nbsp;unprocessed&nbsp;foods.&nbsp;Hypertension&nbsp;is&nbsp;another&nbsp;ailment&nbsp;that&nbsp;we&nbsp;bring&nbsp;upon&nbsp;ourselves&nbsp;with&nbsp;refined&nbsp;grains,&nbsp;sugar,&nbsp;refined&nbsp;oils,&nbsp;margarine,&nbsp;overeating,&nbsp;inactivity,&nbsp;stress,&nbsp;and&nbsp;smoking.<br />\r\nIf&nbsp;you&nbsp;are&nbsp;overweight,&nbsp;begin&nbsp;a&nbsp;program&nbsp;of&nbsp;gradual&nbsp;weight&nbsp;loss.&nbsp;Even&nbsp;beginning&nbsp;to&nbsp;lose&nbsp;weight&nbsp;will&nbsp;lower&nbsp;blood&nbsp;pressure.&nbsp;Keeping&nbsp;weight&nbsp;off&nbsp;is&nbsp;one&nbsp;of&nbsp;the&nbsp;most&nbsp;important&nbsp;strategies&nbsp;for&nbsp;controlling&nbsp;blood&nbsp;pressure.&nbsp;Even&nbsp;losing&nbsp;a&nbsp;pound&nbsp;a&nbsp;week&nbsp;is&nbsp;a&nbsp;significant&nbsp;stride&nbsp;in&nbsp;the&nbsp;right&nbsp;direction.&nbsp;In&nbsp;fact,&nbsp;for&nbsp;hypertensives,&nbsp;slow&nbsp;weight&nbsp;loss&nbsp;of&nbsp;one&nbsp;to&nbsp;two&nbsp;pounds&nbsp;a&nbsp;week&nbsp;is&nbsp;ideal.&nbsp;Anything&nbsp;faster&nbsp;may&nbsp;deplete&nbsp;important&nbsp;blood-pressure-regulating&nbsp;minerals&nbsp;such&nbsp;as&nbsp;magnesium&nbsp;and&nbsp;potassium.<br />\r\nFoods&nbsp;that&nbsp;must&nbsp;be&nbsp;eliminated&nbsp;from&nbsp;the&nbsp;diet&nbsp;of&nbsp;hypertensives:<br />\r\nSalty&nbsp;foods&nbsp;or&nbsp;processed&nbsp;foods&nbsp;high&nbsp;in&nbsp;sodium<br />\r\nCaffeinated&nbsp;coffee<br />\r\nCaffeinated&nbsp;tea<br />\r\nAlcohol<br />\r\nSugar<br />\r\nMargarine&nbsp;and&nbsp;fried&nbsp;foods<br />\r\nRefined&nbsp;white&nbsp;flours&nbsp;and&nbsp;supermarket&nbsp;oils<br />\r\nStimulants&nbsp;such&nbsp;as&nbsp;ephedra&nbsp;(ma&nbsp;huang)&nbsp;and&nbsp;kola&nbsp;nut<br />\r\nRegular&nbsp;aerobic&nbsp;exercise&nbsp;such&nbsp;as&nbsp;walking&nbsp;can&nbsp;help&nbsp;lower&nbsp;blood&nbsp;pressure.&nbsp;It&nbsp;should&nbsp;be&nbsp;done&nbsp;only&nbsp;with&nbsp;your&nbsp;physician&#39;s&nbsp;approval.<br />\r\nYou&nbsp;can&nbsp;help&nbsp;lower&nbsp;your&nbsp;risk&nbsp;of&nbsp;blood&nbsp;pressure&nbsp;problems&nbsp;by&nbsp;excercising.', '2014-10-28 14:44:40', '1', 'Lowering Blood Pressure Naturally', null, null, null, null, null, null, null);
INSERT INTO `findknowledge` VALUES ('f9aa885b494add6a01495581763d0005', null, 'Yoga Relaxation Techniques', 'http://121.42.8.219:80/aiaoleWeb//resources/upload/201501171038509250.jpg', '6', 'True&nbsp;relaxation&nbsp;is&nbsp;experienced&nbsp;by&nbsp;the&nbsp;body&nbsp;and&nbsp;mind&nbsp;when&nbsp;little&nbsp;or&nbsp;no&nbsp;energy&nbsp;is&nbsp;dissipated.&nbsp;There&nbsp;are&nbsp;somethings&nbsp;one&nbsp;can&nbsp;do&nbsp;to&nbsp;relax,&nbsp;including&nbsp;physical&nbsp;and&nbsp;social&nbsp;ac&nbsp;tivities,&nbsp;entertainment,&nbsp;or&nbsp;certain&nbsp;methods&nbsp;of&nbsp;relaxation&nbsp;and&nbsp;meditation,&nbsp;such&nbsp;as&nbsp;with&nbsp;music&nbsp;or&nbsp;guided&nbsp;imagery.<br />\r\nExercise&nbsp;may&nbsp;help&nbsp;with&nbsp;stress&nbsp;relief&nbsp;as&nbsp;it&nbsp;provides&nbsp;a&nbsp;route&nbsp;for&nbsp;the&nbsp;body&nbsp;to&nbsp;release&nbsp;tension&nbsp;and&nbsp;pent-up&nbsp;frustration.&nbsp;The&nbsp;Eastern&nbsp;practices&nbsp;of&nbsp;Yoga&nbsp;and&nbsp;Tai&nbsp;Chi&nbsp;are&nbsp;effective&nbsp;stress-reducing&nbsp;types&nbsp;of&nbsp;exercise.&nbsp;Yoga&nbsp;breathing&nbsp;lowers&nbsp;blood&nbsp;pressure&nbsp;and&nbsp;brings&nbsp;intensive&nbsp;relaxation.<br />\r\nOf&nbsp;course,&nbsp;shallow&nbsp;breathing&nbsp;does&nbsp;not&nbsp;always&nbsp;gines&nbsp;unclear&nbsp;thinking&nbsp;or&nbsp;low&nbsp;spirits,&nbsp;but&nbsp;it&nbsp;has&nbsp;been&nbsp;clinically&nbsp;related&nbsp;with&nbsp;invasions&nbsp;of&nbsp;depression,&nbsp;mood&nbsp;swings&nbsp;and&nbsp;other&nbsp;various&nbsp;disorders.<br />\r\nYoga-Nidra&nbsp;is&nbsp;an&nbsp;portrayal&nbsp;widely&nbsp;used&nbsp;to&nbsp;denote&nbsp;the&nbsp;highest&nbsp;state&nbsp;of&nbsp;consciousness.&nbsp;Though&nbsp;yoga&nbsp;nidra&nbsp;means&nbsp;yogic&nbsp;sleep,&nbsp;it&nbsp;is&nbsp;truly&nbsp;a&nbsp;wakeful&nbsp;state&nbsp;of&nbsp;deep&nbsp;introversion.<br />\r\nYoga&nbsp;postures&nbsp;are&nbsp;designed&nbsp;to&nbsp;balance&nbsp;the&nbsp;various&nbsp;systems&nbsp;of&nbsp;the&nbsp;body,&nbsp;involving&nbsp;the&nbsp;central&nbsp;nervous,&nbsp;the&nbsp;endocrine&nbsp;glandular&nbsp;and&nbsp;the&nbsp;digestive&nbsp;systems.&nbsp;Yoga&nbsp;asanas&nbsp;are&nbsp;a&nbsp;procedure&nbsp;for&nbsp;retraining&nbsp;the&nbsp;muscles&nbsp;to&nbsp;be&nbsp;able&nbsp;to&nbsp;relax.&nbsp;People&nbsp;who&nbsp;practice&nbsp;asanas&nbsp;normally&nbsp;find&nbsp;that&nbsp;they&nbsp;need&nbsp;less&nbsp;sleep&nbsp;and&nbsp;experience&nbsp;more&nbsp;rested.<br />\r\nDru&nbsp;Yoga&nbsp;is&nbsp;a&nbsp;synthesis&nbsp;of&nbsp;ancient&nbsp;ways,&nbsp;which&nbsp;are&nbsp;now&nbsp;being&nbsp;performed&nbsp;to&nbsp;the&nbsp;modern&nbsp;world,&nbsp;offering&nbsp;a&nbsp;unique&nbsp;perspective&nbsp;on&nbsp;yoga&nbsp;practises.&nbsp;This&nbsp;form&nbsp;of&nbsp;yoga&nbsp;conjoins&nbsp;many&nbsp;traditional&nbsp;postures,&nbsp;powerful&nbsp;sequences&nbsp;and&nbsp;visualisations,&nbsp;which&nbsp;are&nbsp;capable&nbsp;of&nbsp;transforming&nbsp;health&nbsp;and&nbsp;well&nbsp;being,&nbsp;by&nbsp;balancing&nbsp;the&nbsp;energies&nbsp;of&nbsp;body,&nbsp;heart&nbsp;and&nbsp;mind.<br />\r\nMental&nbsp;fatigue&nbsp;sets&nbsp;in,&nbsp;usually&nbsp;leading&nbsp;to&nbsp;wear&nbsp;and&nbsp;tear&nbsp;on&nbsp;the&nbsp;physical&nbsp;body&nbsp;as&nbsp;well.&nbsp;It&nbsp;is&nbsp;important&nbsp;to&nbsp;set&nbsp;aside&nbsp;some&nbsp;time&nbsp;each&nbsp;day&nbsp;for&nbsp;the&nbsp;mind&nbsp;to&nbsp;unwind&nbsp;and&nbsp;retrieve&nbsp;its&nbsp;energies.&nbsp;Slowly&nbsp;slide&nbsp;your&nbsp;fingers&nbsp;down&nbsp;your&nbsp;nose&nbsp;and&nbsp;across&nbsp;the&nbsp;top&nbsp;of&nbsp;your&nbsp;cheekbones&nbsp;to&nbsp;the&nbsp;outside&nbsp;of&nbsp;your&nbsp;eyes.&nbsp;It&nbsp;is&nbsp;a&nbsp;Relief&nbsp;Sinus&nbsp;Pressure.<br />\r\nYoga&nbsp;offers&nbsp;the&nbsp;methods&nbsp;for&nbsp;this&nbsp;inner&nbsp;tuning,&nbsp;enabling&nbsp;us&nbsp;to&nbsp;break&nbsp;down&nbsp;the&nbsp;boundaries&nbsp;that&nbsp;separate&nbsp;us&nbsp;from&nbsp;each&nbsp;other,&nbsp;and&nbsp;from&nbsp;our&nbsp;own&nbsp;Inner&nbsp;Selves.&nbsp;Yoga,&nbsp;broadly,&nbsp;is&nbsp;regarded&nbsp;safe&nbsp;if&nbsp;you&#39;re&nbsp;generally&nbsp;healthy.<br />\r\nSome&nbsp;yoga&nbsp;positions&nbsp;may&nbsp;put&nbsp;substantial&nbsp;strain&nbsp;on&nbsp;your&nbsp;lower&nbsp;back&nbsp;and&nbsp;on&nbsp;your&nbsp;joints.&nbsp;Helps&nbsp;us&nbsp;decrease&nbsp;and&nbsp;palliate&nbsp;illusions,&nbsp;fatigue,&nbsp;confusion,&nbsp;inessential&nbsp;burdens&nbsp;and&nbsp;develops&nbsp;a&nbsp;living&nbsp;that&nbsp;is&nbsp;more&nbsp;skillful&nbsp;which&nbsp;allows&nbsp;us&nbsp;to&nbsp;let&nbsp;go&nbsp;of&nbsp;disturbing&nbsp;thoughts&nbsp;and&nbsp;feelings.<br />\r\nIt&nbsp;helps&nbsp;us&nbsp;deal&nbsp;with&nbsp;the&nbsp;life&nbsp;stresses&nbsp;we&nbsp;feel&nbsp;and&nbsp;brings&nbsp;about&nbsp;greater&nbsp;freedom&nbsp;from&nbsp;negative&nbsp;conditioning&nbsp;and&nbsp;repressed&nbsp;reminiscences.&nbsp;Cardio-Yoga&nbsp;(Synbio),&nbsp;a&nbsp;multi-disciplinary&nbsp;workout&nbsp;which&nbsp;combines&nbsp;cardio&nbsp;kick-boxing&nbsp;and&nbsp;yoga&nbsp;techniques&nbsp;which&nbsp;makes&nbsp;this&nbsp;regular&nbsp;extremely&nbsp;rewarding.<br />\r\nYoga&nbsp;nidra&nbsp;includes&nbsp;relaxing&nbsp;the&nbsp;legs&nbsp;and&nbsp;the&nbsp;feet.&nbsp;Yoga&nbsp;is&nbsp;feel&nbsp;the&nbsp;coolness&nbsp;of&nbsp;your&nbsp;breath&nbsp;inside&nbsp;your&nbsp;head,&nbsp;as&nbsp;you&nbsp;inhale.&nbsp;Abstract&nbsp;your&nbsp;mind,&nbsp;and&nbsp;lie&nbsp;peacefully&nbsp;for&nbsp;about&nbsp;five&nbsp;minutes.', '2014-10-28 14:46:28', '1', 'Yoga Relaxation Techniques', null, null, null, null, null, null, null);
