INSERT INTO `weatherinfo` VALUES ('402881ea4a0090ff014a0091c59f0001', '101200101', '2015-03-21', '<?xml version=\"1.0\" encoding=\"utf-8\" ?> <CityWeatherResponse>		  <error>0</error>	    <status>success</status>		    <date>2015-03-21</date>	    <results>              <currentCity>武汉</currentCity>        <weather_data>                            <date>周六 03月21日 (实时：10℃)</date>                <dayPictureUrl>http://api.map.baidu.com/images/weather/day/qing.png</dayPictureUrl>                <nightPictureUrl>http://api.map.baidu.com/images/weather/night/qing.png</nightPictureUrl>                <weather>晴</weather>                <wind>微风</wind>                <temperature>7℃</temperature>                            <date>周日</date>                <dayPictureUrl>http://api.map.baidu.com/images/weather/day/duoyun.png</dayPictureUrl>                <nightPictureUrl>http://api.map.baidu.com/images/weather/night/duoyun.png</nightPictureUrl>                <weather>多云</weather>                <wind>微风</wind>                <temperature>21 ~ 8℃</temperature>                            <date>周一</date>                <dayPictureUrl>http://api.map.baidu.com/images/weather/day/duoyun.png</dayPictureUrl>                <nightPictureUrl>http://api.map.baidu.com/images/weather/night/duoyun.png</nightPictureUrl>                <weather>多云</weather>                <wind>微风</wind>                <temperature>19 ~ 8℃</temperature>                            <date>周二</date>                <dayPictureUrl>http://api.map.baidu.com/images/weather/day/duoyun.png</dayPictureUrl>                <nightPictureUrl>http://api.map.baidu.com/images/weather/night/duoyun.png</nightPictureUrl>                <weather>多云</weather>                <wind>微风</wind>                <temperature>17 ~ 8℃</temperature>                    </weather_data>        <index>                            <title>穿衣</title>                <zs>较舒适</zs>                <tipt>穿衣指数</tipt>                <des>建议着薄外套、开衫牛仔衫裤等服装。年老体弱者应适当添加衣物，宜着夹克衫、薄毛衣等。</des>                            <title>洗车</title>                <zs>较适宜</zs>                <tipt>洗车指数</tipt>                <des>较适宜洗车，未来一天无雨，风力较小，擦洗一新的汽车至少能保持一天。</des>                            <title>旅游</title>                <zs>适宜</zs>                <tipt>旅游指数</tipt>                <des>天气较好，但丝毫不会影响您出行的心情。温度适宜又有微风相伴，适宜旅游。</des>                            <title>感冒</title>                <zs>易发</zs>                <tipt>感冒指数</tipt>                <des>昼夜温差很大，易发生感冒，请注意适当增减衣服，加强自我防护避免感冒。</des>                            <title>运动</title>                <zs>适宜</zs>                <tipt>运动指数</tipt>                <des>天气较好，赶快投身大自然参与户外运动，尽情感受运动的快乐吧。</des>                            <title>紫外线强度</title>                <zs>弱</zs>                <tipt>紫外线强度指数</tipt>                <des>紫外线强度较弱，建议出门前涂擦SPF在12-15之间、PA+的防晒护肤品。</des>                    </index>        <pm25>123</pm25>        </results></CityWeatherResponse>', '2', null, null, null, null, null, null, null, null, '0', '2014-11-30 19:59:20');
